import Products from "../components/Products";
import Categories from "../components/Categories";
import Hashtags from "../components/Hashtags";
export default function() {
  return (
    <div>

      <h1>Data:</h1>
      <Posts />
      <Products />
      <Categories />
      <Hashtags />
    </div>
  );
}
